import React from 'react'
import Card from './Components/Card'
import Data from './Data'

Data.map((val)=>{
    return (
        <Card
        imgsrc={Data[0].imgscr}
        title={Data[0].title}
        sname={Data[0].sname}
        />
    );
})
function App(){
    return <div>
        <h1 className="headingStyle">List of Top 5 series</h1>
        {Data}
    </div>
}
export default App;
